import { useState } from "react";

const tasks = [
  {
    id: 1,
    text: "Doc",
    day: "9.10.2010",
    reminder: true,
  },
  {
    id: 2,
    text: "Dog",
    day: "9.10.2010",
    reminder: true,
  },
  {
    id: 3,
    text: "Mom",
    day: "9.10.2010",
    reminder: false,
  },
];
const Tasks = () => {
  const [tasks, setTasks] = useState([
    {
      id: 1,
      text: "Doc",
      day: "9.10.2010",
      reminder: true,
    },
    {
      id: 2,
      text: "Dog",
      day: "9.10.2010",
      reminder: true,
    },
    {
      id: 3,
      text: "Mom",
      day: "9.10.2010",
      reminder: false,
    },
  ]);
  return (
    <>
      {tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
